import React from "react";

const Header = () => {
    return (
        <div className="tc mt4 mt5-m mt5-l mb3 ph3">
            <h1 className="f2 f1-l fw2 white-90 mb0 lh-title ph3">
                Use the fields below to generate calculators:
            </h1>
        </div>
    )
}

export default Header;
